import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home'; // Burada 'Home' bileşeninin doğru dosya yolunu yazmalısınız
import Categories from './Categories'; // Eğer 'Categories' bileşenini kullanıyorsanız, buraya da import edebilirsiniz

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/categories" element={<Categories />} />
        {/* Diğer rotalarınızı buraya ekleyebilirsiniz */}
      </Routes>
    </Router>
  );
}

export default App;
